import React from 'react';
import { useHistory } from 'react-router-dom';

function IndexPage() {
  const history = useHistory();

  const goToLogin = () => {
    history.push('/login');
  };

  const goToSignup = () => {
    history.push('/signup');
  };

  return (
    <div style={styles.container}>
      <h1>Welcome to HistoricalWeb</h1>
      <div style={styles.buttonContainer}>
        <button style={styles.button} onClick={goToLogin}>Login</button>
        <button style={styles.button} onClick={goToSignup}>Signup</button>
      </div>
    </div>
  );
}

const styles = {
  container: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: '100vh',
    backgroundColor: '#f0f0f0',
  },
  buttonContainer: {
    display: 'flex',
    justifyContent: 'space-between',
    width: '200px',
    marginTop: '20px',
  },
  button: {
    padding: '10px 20px',
    fontSize: '16px',
    cursor: 'pointer',
    backgroundColor: '#007bff',
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
  },
};

export default IndexPage;
